\n5. Morning cloudless walks \ud83c\udf34 \n\n6. \ud83c\udf3a and \u2600\ufe0f \n\n7. Thanks to all the fans who came out to support and cheered on from home ( also huge thanks to my friends who traveled from all over to share this journey with me) \u2764\ufe0f \n\n8. Honestly a very proud moment \u263a\ufe0f \nLeo : I\u2019m just going to meditate like momma does \ud83d\ude0a \n\n9. Hell of a battle in the finals! Congratulations @paulabadosa I want a rematch \ud83d\ude02 \n\n10. End of this season for me with lots of lessons and finishing the year with a lot of encouragement. \n\nI\u2019m looking forward to coming back in March to Indian Wells again and thanks to everyone for making it possible at a difficult time and all the effort for us to be able to live our passion and dreams. See you soon \ud83c\udf34 springs!\n\n\u2764\ufe0f \n  V"}}]},"edge_media_to_comment":{"count":1225},"comments_disabled":false,"taken_at_timestamp":1634587913,"edge_liked_by":{"count":46582},"edge_media_preview_like":{"count":46582},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/s640x640/246283377_4554722954593030_7132309366836291890_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=BoKOD09d7O0AX_ZbAJg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=d9ea77829c418dd7a7deda7242ee9b38\u0026oe=619DD9E1\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s150x150/246283377_4554722954593030_7132309366836291890_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=BoKOD09d7O0AX_ZbAJg\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=7e81f67b6a0c37e093be48bfde4004dd\u0026oe=619E1316\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/s240x240/246283377_4554722954593030_7132309366836291890_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=BoKOD09d7O0AX_ZbAJ :false,"id":"12859058","is_verified":false,"profile_pic_url":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-19/s150x150/175671413_198794878719101_4950200926686054726_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=d5nRDOrcgjkAX-eT-_S\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=7dbfd8f9be800e0d23ea3100c1c08944\u0026oe=619E073F\u0026_nc_sid=7bff83","username":"eugeyonce"},"x":0.0,"y":0.0}}]},"fact_check_overall_rating":null,"fact_check_information":null,"gating_info":null,"sharing_friction_info":{"should_have_sharing_friction":false,"bloks_app_url":null},"media_overlay_info":null,"media_preview":null,"owner":{"id":"27890812","username":"vichka35"},"is_video":false,"has_upcoming_event":false,"accessibility_caption":"Photo shared by Victoria Azarenka on September 09, 2021 tagging @hudsonyards. May be an image of one or more people, people standing and indoor.","edge_media_to_caption":{"edges":[{"node":{"text":"NYC US open 2021\nRecap: \n\n1. Coming back to stay in my favorite place @hudsonyards (one of the coolest thing is to see the same awesome people working there :) it feels like home :) the best \ud83d\ude4f\ud83c\udffb \n\n2. Selfie with lemons (because well if you got lemons let\u2019s make lemonade :) \n\n3. My improv addition of art \ud83c\udfa8 to a shirt at Leo\u2019s art and crafts class ( I\u2019m kinda super proud of that one ) should I do more? \n\n4. Arts and crafts with Leo ( Leo loves glitter\u2026 and then it\u2019s everywhere for days no matter how many times you shower after that ) \n\n5. Tacos \ud83c\udf2e night with \ud83c\uddf2\ud83c\uddfd @eugeyonce Martha and Nadia \n\n6. We met this wonderful and friendly dog on our walk by Central Park ( I think Leo wants the dog too) \n\n7. Central Park rocks and skyscrapers \ud83c\udfd9 \n\n8. Morning meditations with Leo ( I do meditation every morning and Leo got interested in doing it with me. But the best thing about it that now he goes and does it himself too and asks me mom let\u2019s do a meditation. I personally have moments where I wish my parents would introduce me to it. But in our culture it was never really something you do. I\u2019m very grateful I have this sharing experience with Leo. \n\n9. Sunsets at @hudsonyards \u2764\ufe0f \n\n10. And tennis: \nSo much I can talk about on this subject, on this tournament and match and etc. \nBut I will say one thing and I feel like I\u2019m talking like an older person with the back in my day type of quote, but really for one second\u2026 \nI could be more grateful for all the support and real connection I have in my life because that is something that is the most meaningful in the end of the day! And in my opinion you only truly see it when it\u2019s more quiet around :) \nThank you \ud83d\ude4f\ud83c\udffb \n\nTill next time \u2764\ufe0f \nV"}}]},"edge_media_to_comment":{"count":289},"comments_disabled":false,"taken_at_timestamp":1631201483,"edge_liked_by":{"count":20978},"edge_media_preview_like":{"count":20978},"location":null,"thumbnail_src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/241314705_4335584163189183_382723891258904074_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=loaa5vzbl-wAX-21cpm\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=9fc6dd34e50f6ef6756c317807cbcd31\u0026oe=619D2746\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/241314705_4335584163189183_382723891258904074_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=loaa5vzbl-wAX-21cpm\u0026edm=ABfd0MgBAAAA\u0026ccb=7-4\u0026oh=7ab8951d5729595774e8ddd37b71c41f\u0026oe=619DD536\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.fudi2-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s240x240/241314705_4335584163189183_382723891258904074_n.jpg?_nc_ht=instagram.fudi2-1.fna.fbcdn.net\u0026_nc_cat
